import React from "react";
import "../styles/FindWork.css";

function FindWork() {
  const projects = [
    {
      title: "Logo Design for Startup",
      desc: "Looking for a creative designer to craft a modern, minimal logo for our tech startup.",
      budget: "$150 - $300",
      skills: ["Photoshop", "Illustrator", "Branding"],
    },
    {
      title: "Full Stack Developer for Portfolio Website",
      desc: "Need a MERN developer to build a responsive and dynamic personal portfolio site.",
      budget: "$300 - $600",
      skills: ["React", "Node.js", "MongoDB", "Express"],
    },
    {
      title: "Mobile App UI/UX Designer",
      desc: "Design sleek mobile app interfaces for both Android and iOS platforms.",
      budget: "$200 - $400",
      skills: ["Figma", "UI/UX", "Prototyping"],
    },
    {
      title: "Social Media Content Creator",
      desc: "Create eye-catching posts and reels for a fashion brand’s Instagram page.",
      budget: "$100 - $250",
      skills: ["Canva", "Social Media", "Content Writing"],
    },
    {
      title: "Backend API Developer",
      desc: "Develop secure REST APIs for an e-commerce application using Node.js.",
      budget: "$400 - $700",
      skills: ["Node.js", "Express", "JWT", "MongoDB"],
    },
    {
      title: "SEO Expert for Blog Optimization",
      desc: "Improve ranking and traffic for a tech blog through SEO and content strategy.",
      budget: "$150 - $350",
      skills: ["SEO", "Google Analytics", "Content Writing"],
    },
  ];

  return (
    <div className="findwork-container">
      <h1>Explore Freelance Projects</h1>
      <p className="subtitle">Browse the latest opportunities and start working with clients today.</p>

      <div className="projects-grid">
        {projects.map((project, index) => (
          <div className="project-card" key={index}>
            <h3>{project.title}</h3>
            <p>{project.desc}</p>
            <p className="budget"><strong>Budget:</strong> {project.budget}</p>
            <div className="skills">
              {project.skills.map((skill, i) => (
                <span key={i} className="skill-tag">{skill}</span>
              ))}
            </div>
            <button className="btn primary-btn">Apply Now</button>
          </div>
        ))}
      </div>
    </div>
  );
}

export default FindWork;
